BE3 takes Kanye&amp;#039;s production on a journey through life on London&amp;#039;s streets, through the eyes of DOC4 the verbal physician. From tracks like &quot;London City&quot;, giving you a real perspective of life in the capital, to the likes of &quot;My Sista&quot;, a soulful blend of righteous teachings and skillfull storytelling. 



This Mixtape has the combination of raw lyrics and concious delivery, driven by the &quot;real&quot; of Hip Hop. 


